import React from "react";
import './styles/App.css';
import Slider from './Slider';
import Banner from './Banner';
import Hero from './Hero';
function Main(){
    return(
        <div className="main">
            <Banner />
            <Hero />
            <Slider />
        </div>
    )
}
export default Main
